import React, {
	Component
} from 'react';
export default class Test extends Component {
	constructor() {
		super()
    	this.handleClick = this.handleClick.bind(this);
	}
	handleClick(e) {
		console.log(e);
	}
	render() {
		return (
    <a href="#" onClick={handleClick}>
      Click me
    </a>
		);
	}
}
